<script setup lang="ts">
import { onMounted, onBeforeUnmount, ref, nextTick } from 'vue'

// Elevate department region and its label together on hover
const svgEl = ref<SVGSVGElement | null>(null)

type Pair = { region: SVGPathElement; label: SVGPathElement; enter: () => void; leave: () => void }
const pairs: Pair[] = []

onMounted(async () => {
  await nextTick()
  const svg = svgEl.value
  if (!svg) return

  // Identify candidate region paths and label paths
  const regionEls = Array.from(svg.querySelectorAll('path[mask]')).filter(
    (p): p is SVGPathElement => (p as SVGPathElement).getAttribute('fill')?.toLowerCase() !== 'white'
  )
  const labelEls = Array.from(svg.querySelectorAll('path:not([mask])')).filter(
    (p): p is SVGPathElement => (p as SVGPathElement).getAttribute('fill')?.toLowerCase() === 'white'
  )

  // Precompute label centers
  const labelCenters = new Map<SVGPathElement, { cx: number; cy: number }>()
  for (const l of labelEls) {
    try {
      const b = l.getBBox()
      labelCenters.set(l, { cx: b.x + b.width / 2, cy: b.y + b.height / 2 })
      l.classList.add('dept-label')
      l.style.pointerEvents = 'auto'
    } catch {
      // getBBox can fail for elements not in the render tree; ignore
    }
  }

  const addHandlers = (region: SVGPathElement, label: SVGPathElement) => {
    region.classList.add('dept-region')
    label.classList.add('dept-label')

    const enter = () => {
      region.classList.add('dept-hover')
      label.classList.add('dept-hover')
    }
    const leave = () => {
      region.classList.remove('dept-hover')
      label.classList.remove('dept-hover')
    }

    region.addEventListener('mouseenter', enter)
    region.addEventListener('mouseleave', leave)
    label.addEventListener('mouseenter', enter)
    label.addEventListener('mouseleave', leave)

    pairs.push({ region, label, enter, leave })
  }

  // Pair each region with the nearest label by center distance
  for (const r of regionEls) {
    let rb
    try {
      rb = r.getBBox()
    } catch {
      continue
    }
    const rcx = rb.x + rb.width / 2
    const rcy = rb.y + rb.height / 2

    let best: SVGPathElement | null = null
    let bestD = Infinity
    for (const [l, c] of labelCenters.entries()) {
      const dx = c.cx - rcx
      const dy = c.cy - rcy
      const d = dx * dx + dy * dy // squared distance is enough
      if (d < bestD) {
        bestD = d
        best = l
      }
    }
    if (best) addHandlers(r, best)
  }
})

onBeforeUnmount(() => {
  for (const { region, label, enter, leave } of pairs) {
    region.removeEventListener('mouseenter', enter)
    region.removeEventListener('mouseleave', leave)
    label.removeEventListener('mouseenter', enter)
    label.removeEventListener('mouseleave', leave)
  }
})
</script>

<style scoped>
/* Smooth lift interaction for departments and labels */
.dept-region,
.dept-label {
  transition: transform 220ms ease;
  transform-box: fill-box;
  transform-origin: center;
  cursor: pointer;
}

.dept-hover {
  transform: scale(1.06);
}
</style>
